import Foundation
class Mockapiengine{
    
    init(){
        let dataValue: Data = dataString.data(using: String.Encoding.utf8)!
        let decoder = JSONDecoder()
        if let result =  try? decoder.decode([noteModel].self, from: dataValue) {
            dataHold = result
        }
    }
    
    
    class var sharedManager: Mockapiengine {
        struct Static {
            static let instance = Mockapiengine()
        }
        return Static.instance
    }
    
    
    public func fetchData( page: Int, completion: @escaping (_ result: [noteModel]) -> Void) {
        
        
        DispatchQueue.main.asyncAfter(deadline: .now() + 5.0, execute: {
            let min = (page * 20)
            var max = (min + 20)
            
            if(max > self.dataHold.count){
                max = self.dataHold.count
            }
            var returndata:[noteModel] = []
            if(min < self.dataHold.count){
                returndata = Array(self.dataHold[min..<max])
            }
            
            completion(returndata)
        })
        
        
    }
    
    
